INSERT INTO "incidents" VALUES(1,'0f507cf3-6c81-4e06-bc21-e6f069abb4b7','10-year-old boy is tasered by a police officer for refusing to wash the police officer''s car. The lawsuit claims police officers drove their patrol cars onto the intermediate school campus, where Webb asked a group of boys which one would like to clean his patrol unit. R.D. raised his hand to say he did not want to clean the police officer’s car.
INSERT INTO "incidents" VALUES(2,'b9fc72a0-8bff-4325-a40d-b8a6e4b250f8','Off duty cop pulls his gun on a man and hits him in the face with his badge. A former New Mexico sheriff was sentenced to 10 years in prison by a federal court on Wednesday after he was found guilty of violating a motorist''s civil rights last year when he dragged the man from his car and threatened him with a gun.
INSERT INTO "incidents" VALUES(3,'210e85f9-6fca-425d-ba25-002f57c21fcd','Officer pulls a woman over for having expired tabs (she didn''t) but really used it as an excuse to meet the woman. Turns off his dash cam and mic then contacts her several times after the stop presumably looking for a date.',2014,8,2014,9,'2014-09-27 21:20:29.663960','2014-11-13 04:10:58.865549','TN','Mt. Juliet',NULL,'','traffic-stop',1,'f','','f','f','t','t','f','f','',NULL,3,1,NULL);
INSERT INTO "incidents" VALUES(4,'4afd6810-ae5d-435d-a3a6-dc49a6c63b9b','Officer straddles woman on the side of the highway and beats her repeatedly in the heat and face.
INSERT INTO "incidents" VALUES(5,'941dbd94-44de-4e61-b6e2-614bb2b1e337','Man was praying over his dead son in hospital when officers tased him and took him into custody.',2014,6,2014,9,'2014-09-27 21:47:02.014396','2014-09-27 21:47:02.014396','PA','Pittsburgh',NULL,'Mercy Hospital','other',1,'f','Earl Baldwin Jr','t','f','f','f','f','f','',NULL,5,5,NULL);
INSERT INTO "incidents" VALUES(6,'785c984e-727c-4188-a265-59b167206930','A decorated veteran police sergeant has pleaded guilty to beating a handcuffed man and now faces up to 10 years in prison. The DOJ said Arigo walked into the room were Bloss was being held and "shoved his head into the bench, and punched him in the head multiple times." Arigo also pulled the video camera out of the wall to stop it from recording, the DOJ said.',2014,1,2014,1,'2014-09-27 21:54:49.853133','2014-11-27 04:29:13.593506','NY','Fulton',NULL,'Beating happened while at the police station','custody',1,'f','Gary E. Bloss.','t','f','t','f','f','f','',NULL,6,1,NULL);
INSERT INTO "incidents" VALUES(12,'e97fbfc0-ea37-41e9-a1e6-3072e8ca43a1','Officers put a man into a van and then drive recklessly (probably on purpose) resulting in severe injuries. Officers then lie on the witness stand and have their testimony refuted by expert witness. ',2011,6,2014,9,'2014-09-28 19:56:25.404810','2014-11-13 04:42:07.993569','PA','Phillidelphia',NULL,'Center City neighborhood','911',1,'f','James McKenna','t','f','t','f','f','t','McKenna was then handcuffed and put in the van, but not strapped in. He said police accelerated and decelerated the wagon, knocking him to the floor four times. McKenna’s injuries included three broken neck vertebrae and two ruptured neck discs. The case was so inundated with lies however, that none of the officers could get their stories straight so there were also reports stating that he “hit [his] head on police car door” and that “while being transported, pt. hit his own head against divider as reported by arriving officers.” As part of the lawsuit, Thomas J. Gibbons, McKenna’s lawyer, presented an expert opinion from a doctor who said McKenna’s injuries were far too serious to have been self-inflicted.',490000,10,NULL,NULL);
