INSERT INTO "incidents" VALUES(41,'3e937d5f-7601-473a-b1ac-60bbdaeb1dfc','Police force entry into a home without a warrant and physically assault family members looking for drugs. Officers claimed they were let in voluntarily and then people started swinging at them, but those claims did not hold up in court. "I was very thankful to the jury that the Constitution was upheld. Hopefully we''re turning a corner in Denver," said Kathryn Stimson, who represented Daniel Martinez Jr. and three of his four sons along with attorney David Lane. Denver police Officer Jason Valdez, who later acknowledged seeing but disregarding the sign, pounded on the front door and yelled "Open the damn door right now!" the lawsuit says. When Daniel Martinez opened the door a crack, three Denver police officers rushed into the home without invitation.',2009,1,2011,NULL,'2014-09-30 15:35:28.954669','2014-11-27 04:30:28.780728','CO','Denver',NULL,'1263 stuart street denver co
