INSERT INTO "incidents" VALUES(81,'f949cd33-646a-4725-b9a5-cfa82e57e038','Officer steals money and jewelery from a dying man at a motorcycle crash. Prosecutors said Huntsman was caught on his cruiser''s video camera stealing from John Scalesse, 49, who lay dying after his motorcycle crashed on the Merritt Parkway in Fairfield on on Sept. 22, 2012. They said he later told Scalesse''s family he didn''t see any money on his body; it was found under the seat in Huntsman''s patrol car.',2012,1,2014,10,'2014-10-13 14:13:33.252616','2014-11-27 04:35:04.643392','CT','Fairfield',NULL,'','911',NULL,'f','','f','f','t','f','f','f','',NULL,50,1,NULL);
INSERT INTO "incidents" VALUES(82,'eba0d8a2-34be-4a95-a311-2b6de410a7de','Deputies violated the rights of barbers at Strictly Skillz barbershop during a 2010 raid in the guise of a license inspection, a federal appeal court said this week, in a strongly-worded rebuke of the Orange County Sheriff''s Office.
INSERT INTO "incidents" VALUES(83,'dc9224bc-45b9-4e4b-8c73-585d14fb4017','Police send a SWAT team to raid a house and arrest man for having a twitter account parodying the mayor.     PEORIA — Police searched a West Bluff house Tuesday and seized phones and computers in an effort to unmask the author of a parody Twitter account that purported to be Mayor Jim Ardis. The account — known as @Peoriamayor on the popular social media service that limits entries to 140 characters — already had been suspended for several weeks when up to seven plainclothes police officers executed a search warrant about 5:20 p.m. at 1220 N. University St.',2013,4,2014,9,'2014-10-13 19:45:07.396334','2014-10-13 19:45:07.396334','IL','Peoria',NULL,'','search-warrant',2,'f','','f','f','t','t','f','f','',NULL,52,NULL,NULL);
INSERT INTO "incidents" VALUES(84,'d714e592-445d-429d-895c-a93988e0efd4','Police recently detained every patron in Cahoots in Louisville and searched all them one by one before they were allowed to leave. They were there because of a liquor license issue, according to the internet, which suggests this is a little unfair — and illegal. The video -- shot Tuesday night by someone inside the bar -- allegedly shows a LMPD officer telling patrons and employees to sit down, stay there, and wait to be frisked. The video had more than 12,000 views on YouTube in less than 24 hours.
INSERT INTO "incidents" VALUES(85,'aa158b9a-3dea-4d9b-b897-b124a546cebd','A Colorado family said that it was stunned over the weekend when an officer broke down their door, and fatally shot one of the residents in the back without an explanation. Sara Lindenmuth told KRDO that a Rocky Ford police officer forced down the door to their home sometime after her brother-in-law, 27-year-old Jack Jacquez, came home around 2 a.m. on Sunday morning. “He was standing next to his mom, his back turned toward the officer and then he shot him twice in the back and then pepper sprayed him,” Lindenmuth said. “Then they hand cuffed his fiancé, for reasons I don’t know why. And the mom went to call the cops and the cop took her phone and threw it against the wall.” The Rocky Ford police officer involved in the shooting, James Ashby, is on administrative leave pending the investigation. ',2014,10,2014,10,'2014-10-14 01:28:16.137711','2014-10-14 01:28:16.137711','CO','Rocky Ford',NULL,'','unknown',1,'f','','t','t','f','f','f','f','Breaking down the door, destroying the phone, and shooting an unarmed man in the back.',NULL,54,1,NULL);
INSERT INTO "incidents" VALUES(86,'979cdc7b-634c-4de6-a221-80c8ad049c77','Officer draws gun and threatens to put a round in an unarmed man''s ass because he didn''t show enough fear to the police. That cop slapped the phone out of his hand, then yanked the man out of the car, throwing him facedown on the grass while another cop with his gun drawn comes charging towards the other men, threatening to shoot one of them for who knows what. “I’ll put a round in your ass so quick,” the cop said, even though none of the men in the car were doing anything more than being assertive about their rights, even if they were doing it in a profane manner, which is protected by the First Amendment. Statement from police chief: "When I watch this video, I don’t see a car full of young men who are behaving in a manner consistent with fear of the police."',2013,2,2014,7,'2014-10-14 01:37:45.352728','2014-10-14 01:37:45.352728','FL','Boynton Beach',NULL,'','traffic-stop',4,'f','','t','f','f','t','f','f','',NULL,55,2,NULL);
INSERT INTO "incidents" VALUES(87,'099aeadc-2fcc-450d-b034-6a30d5a96eeb','In 2009, David Afanador was one of five officers who were defendants in a lawsuit against the NYPD. According to the complaint, Afanador and four of his colleagues were strip-searching a suspect on the street when plaintiff Ranique Williams walked by. For whatever reason—legally, he never needed one—Williams whipped out his camera and started snapping pictures. Bad idea. Immediately, Williams was detained. He tried to call 911 to complain and asked for their badge numbers. They didn’t give any. Instead, they roughed him up, “slapping” the phone from his hand, “striking” him in the face and head, then “punching” him in the face while he was still handcuffed in the back of a police cruiser, never telling him he was under arrest. They also took his camera and his flash drive without a warrant. As if that weren’t enough, the complaint alleges, Afanador and his colleagues initiated a malicious prosecution against Williams in an attempt to cover up the violent false arrest and the illegal search-and-seizure. (That prosecution was dismissed in 2009.)',2008,NULL,2014,10,'2014-10-14 01:47:27.675889','2014-11-27 04:36:58.635113','NY','New York',NULL,'','recording',1,'f','','t','t','t','f','f','t','',37500,31,2,NULL);
INSERT INTO "incidents" VALUES(89,'856fbcf4-83ef-4d38-bdc1-f41281781423','According to the ACLU of Maine complaint, Walker and Scattoloni were arrested on a weekend night this past May after they used a smartphone to visually record a group of Portland police officers who were questioning a woman on the sidewalk of Spring Street in downtown Portland. They were in Portland for the weekend and were walking back to their hotel room when they came across the encounter.
INSERT INTO "incidents" VALUES(90,'8de71eb8-85da-4460-99de-5875142431f6','Officers come onto a person''s property with no warrant, shoot their dog, and enter their home without permission. When the dog didn''t die, they came back later with an order to seize the dog. Ms. Shimburski said that she looked out the window and saw two vehicles parked outside — a car and an SUV — along with unidentified men, one of whom had a gun drawn.
INSERT INTO "incidents" VALUES(91,'4186116d-67b9-474d-934d-744bee0f9405','DHS raids a home looking for guns but only confiscates documents related to whistleblowers. Settlement. Ostensibly, the federal investigators and Maryland State Police were raiding the home to determine if Hudson’s husband, Paul Flanagan, owned any weapons. Mr. Flanagan cannot legally be armed, as he has a record from the mid-1980s of breaking gun control laws; subsequently placing him among the growing list of Americans suffering under lifelong infringement of their inalienable rights. Police justified the 2013 raid by claiming that they suspected that he might have owned a “potato gun.” Following the raid, it became clear that the agents were rooting through her private files related to her journalism work. Among the boxes were handwritten notes and lists explicitly naming the whistleblowers who had helped her expose problems in the federal government. These individuals had spoke under conditions of anonymity to protect themselves from retaliation. Yet, using a warrant that expressly stated “guns” as the reason for the search, Ms. Hudson’s private documents were carted away and placed into the hands of the federal government.',2013,8,2014,10,'2014-10-14 13:53:13.687129','2014-10-14 13:53:13.687129','MD','',NULL,'','search-warrant',2,'f','','f','t','f','f','f','f','although they had a search warrant, the officers took things that were not related to the items described in the warrant.',75000,58,NULL,NULL);
INSERT INTO "incidents" VALUES(92,'2c3ebeae-dc20-4e82-993a-05fa91bb6ceb','EASTON, CT — Police violently broke in on a couple of men watching television, exploded concussion grenades, and shot one man roughly a second after entry. The fatal, under-investigated raid yielded no arrests and led to the shooter being named “Officer of the Year.” All because someone was suspected of getting high without government permission.The disturbing operation happened on the afternoon of May 18th, 2008. Homeowner Ronald Terebesi was sitting in his living room with his friend, 33-year-old Gonzalo Guizan of Norwalk.
INSERT INTO "incidents" VALUES(93,'63bdd08d-1561-45f1-b075-b1c9359f02da','A Broward Sheriff''s deputy is accused of accepting oral sex in exchange for not arresting a woman in Dania Beach.
INSERT INTO "incidents" VALUES(94,'4aaaaa38-7273-4b9f-a213-27176f5b4cd7','NASA SWAT Team arrests woman at a Denny''s and steals her property. Joann Davis, needing to raise money to care for her sick son, decided to sell a gift that was given to her husband 42 years earlier by astronaut Niel Armstrong.  Davis’ husband, who passed away in 1986, was a space-engineer, NASA-contractor, and friend of Armstrong’s.  Davis received from him a speck of dust from the moon, embedded into a decorative paperweight. Davis and the undercover agent agreed to meet up at a Denny’s restaurant in Lake Elsinore, CA.  As Davis sat across from the would-be buyer, an armed team of NASA cops waited outside.  When she placed the paperweight on the table, the strike team made their entrance.
INSERT INTO "incidents" VALUES(95,'8ea37925-3868-46f0-8aa6-89867306cbef','SUNSET PARK — A 72nd Precinct police officer was suspended after he kicked a fruit vendor in the back “totally unprovoked” during an arrest at a neighborhood street fair, NYPD Commissioner Bill Bratton said Wednesday.
INSERT INTO "incidents" VALUES(96,'90fbf050-41bf-4291-a92e-c5a7c569d114','The New York City Police Department''s Internal Affairs division is investigating an incident in which a number of officers were caught on tape apparently beating a Bronx man during an arrest. Soon, more officers arrive, and the video shows Hernandez being beaten by several of them. The incident happened on August 18th, 2014 at about 6 p.m. While waiting for a friend, 23-year-old Santiago Hernandez stood in front of a building in the Melrose section of the Bronx. He and another individual were approached by officers who were allegedly investigating a noise complaint.
INSERT INTO "incidents" VALUES(97,'dc5dee79-69e3-4021-bdd8-9f02ef7bdccd','During a stop, police officer threatens the life of Teodulu Sanchez multiple times.The officer tells the driver to turn off the vehicle, asks if he has any weapons, and tells him to put his hands on the steering wheel.
INSERT INTO "incidents" VALUES(98,'878ea396-d919-442f-8e5d-92bac08465cf','Police beat a man because they thought he might know something about a crime that happened a few decades ago. St. Paul agreed to a $45,000 settlement with Gerald R. Hutchinson, 60, who last year sued the city and officers David Stokes, Laura Boulduan, Jeffrey Lewis and Michael McGinn. As part of the deal, the city admits no wrongdoing, said city attorney Sara Grewing, who added that it was in the taxpayers’ best interest to avoid a trial. The alleged beating occurred on or around March 28, 2007, after he returned home after receiving a phone call from his wife, who told him that police were at their house because someone had broken into their garage. As he walked toward the squad car, an officer yelled at him to put his hands behind his back. When Hutchinson tried to explain that he had spoken to police earlier, two officers punched and kicked him. An officer arriving in a second squad car jumped on Hutchinson’s back and head. Hutchinson, who was arrested and detained for three days, suffered a black eye, bruising, cuts and pain from the attack. Hutchinson’s attorneys said that he was beaten because his ex-girlfriend had told police that he had knowledge about the 1970 shooting death of St. Paul officer James Sackett, a case that went unsolved until 2006, a year before Hutchinson was allegedly beaten.',2007,3,2014,10,'2014-10-15 19:21:41.996247','2014-10-15 19:21:41.996247','MN','St. Paul',NULL,'','911',1,'f','','t','f','t','f','f','f','',45000,63,4,NULL);
INSERT INTO "incidents" VALUES(99,'1c187de5-2b3d-4290-ab69-58910079769b','"Charles Locke is a police officer who had sex with a child while wearing his uniform,'''' the prosecutor wrote. "Entrusted with protecting the people of Cleveland, Locke betrayed that trust and took advantage of one of the city''s most vulnerable citizens to sexually gratify himself.'''' Charles Locke, 42, pleaded guilty in Cuyahoga County Common Pleas Court to five counts of pandering sexually oriented matter involving a minor, two counts of unlawful sexual conduct with a minor and one count of possessing criminal tools.',2014,7,2014,10,'2014-10-15 21:41:47.342112','2014-10-15 21:41:47.342112','OH','Cleveland',NULL,'','unknown',1,'f','','f','f','f','f','t','f','',NULL,64,1,NULL);
