INSERT INTO "incidents" VALUES(102,'b0806f6e-28eb-4d19-a624-d480e1ce27d2','BRADFORD COUNTY, PA — A motorist was viciously beaten, tasered, and maced repeatedly, then charged with 24 separate crimes and maliciously prosecuted for every one of them. He was beaten four (4) times over the course of 11-hours, and not once had he acted maliciously. The incident stemmed from his driving while on an unusually high dosage of legally-prescribed bipolar medication and a subsequent fender bender. Dash-cam footage revealed the extraordinary exaggerations made about the case — 2 years after it took place.
INSERT INTO "incidents" VALUES(103,'8f22ed13-51d1-4ad6-837f-30dcc6c7bfa0','Austin police fired a lieutenant Wednesday after an internal affairs investigation determined he made false reports to have the husband of a woman who was having an affair with him arrested.
INSERT INTO "incidents" VALUES(104,'e39e0f17-7fc4-4039-91b1-5781c5bdeffc','An Alabama police officer Maced a 17-year-old girl and framed her for “unlawfully consuming alcohol” as a minor after she broke off their sexual relationship, a federal lawsuit claims. Alexandria Quinn, now 21, sued Officer Levy Kelly, 40, and the City of Tuskegee, Ala., in the federal court in Montgomery on claims of assault and battery, false arrest and false imprisonment. She also accuses the City of Tuskegee of negligent supervision. According to the complaint, Kelly has been indicted on multiple counts of statutory rape against Quinn and “at least one other victim.” she claims he continued to contact her, and on Oct. 13, 2012, allegedly pulled up alongside her parked car and “without any warning” sprayed her in the face with mace. Quinn says he then opened a bottle of beer he found in her car “to make it appear that Ms. Quinn was consuming alcohol” and then arrested her for minor consumption.',2008,NULL,2014,NULL,'2014-10-27 01:29:33.150452','2014-10-27 01:29:33.150452','AL','Tuskegee',NULL,'','other',1,'f','','t','f','t','f','t','f','statutory rape, macing the victim, and framing her for under age consumption',NULL,68,1,NULL);
INSERT INTO "incidents" VALUES(105,'237ff960-d061-43a9-a775-f8bceaccd4c5','A video showing a Pittsburgh Police officer using what appears to be excessive force on a 19-year-old Pittsburgh PrideFest attendee, has sparked outrage online after it was shared on Facebook late Sunday afternoon. The girl was debating with one of the protesters, and she stepped closer without even realizing it and the officer ran over to her. He grabbed her by the back of her neck, pulled her over, dropped her on the ground, pulled her up by her hair, and said “Do you want me to hit you.” When she didn’t respond, he hit her in stomach area about 4 or 5 times repeatedly. After everyone yelled at him, he hand cuffed her, put her against a wall. She was crying against a wall next to her ‘attacker’ while her fiancee was panicking trying to find someone who recorded it.',2014,6,2014,6,'2014-10-27 01:49:32.865104','2014-10-27 01:49:32.865104','PA','Pittsburgh',NULL,'','protest',1,'f','','t','f','t','f','f','f','Struck the woman multiple times without provocation and arrested her for resisting arrest. Lied about being being punched and kicked.',NULL,5,1,NULL);
