INSERT INTO "incidents" VALUES(107,'1758032e-002a-4260-8f0b-808b3f6e7db0','Police officer shoots dog that lunged at him from inside a car with the window rolled up. Received pay cut. A picture on his Facebook page indicates that the officer fired through a window. Jones posted on Facebook that the police department has offered to buy him a new window. Coeur d''Alene Police Officer David Kelley, a 17-year veteran of law enforcement, shot and killed the dog, named Arfee, through the window of a van parked outside a Coeur d''Alene coffee shop. While Kelley maintained that he was afraid of being bitten by the dog—initially reported by police as a "vicious pit bull"—a review of the incident concluded that his decision to fire on the animal violated the department''s deadly force policies.',2014,7,2014,7,'2014-10-27 02:52:01.318241','2014-10-27 02:52:01.318241','ID','Coeur d’Alene',NULL,'','911',NULL,'t','','t','f','f','f','f','f','',NULL,70,NULL,NULL);
INSERT INTO "incidents" VALUES(108,'07964d6a-9d72-4877-b9ab-b84b970a1849','Officers beat and taze a man to the point he goes into cardiac arrest. Dr. Randal Cox was hosting his terminally ill son’s 18th birthday when six police officers from two different precincts showed up to his door. “Somebody grabbed me around the neck, they body slammed me then multiple people got on top of me then I started getting Tased,” said Cox.
INSERT INTO "incidents" VALUES(109,'95e7d7b6-26c1-40ea-ba0a-3ac8afd96af7','Police use SWAT team for simple arrest. Detain and question other family members without reasonable suspicion they had committed any crime.  The city of Pittsburgh will pay a Carrick family $107,500 to settle a civil rights lawsuit tied to a December 2010 SWAT team raid, an attorney for the family said Wednesday.
INSERT INTO "incidents" VALUES(110,'bd876256-6438-4d2c-b168-c2310ad1b633','Officer coaxes friendly dog over to him then shoots the dog dead. Claims in police report that the dog was aggressive, baring teeth and growling but video clearly shows the dog was not aggressive at all. The dog, Maximus, belonged to Quinton Tatum and his wife, Amanda Henderson. As recorded on his body-camera, the Cleburne officer then began coaxing the dogs over to him by making kissing sounds, which can be heard in the video. The dogs respond by wagging their tails and exhibiting very friendly body language, video shows.
