INSERT INTO "incidents" VALUES(113,'8627c438-6c54-4ac9-8d8c-b4445273a3fe','Philadelphia cop curses at a pedestrian and threatens to injure him. A Philadelphia police officer who was caught on video cursing and threatening a teenager will face disciplinary action, according to police. A video was posted on Facebook October 17 showing the unidentified officer following a teen boy as he walked home with a group of other teens.
