INSERT INTO "incidents" VALUES(126,'464c6d3a-6333-4c99-b0cb-ae123ef160ac','A Connecticut city''s reputation as one of America''s most dangerous communities did not give police officers the right to invade a yard where they killed a family dog after getting an erroneous tip that guns were hidden in an abandoned car behind the home, a federal appeals court said Thursday.A three-judge panel said a trial can decide damages owed by the city of Hartford after two police officers lacking a warrant or probable cause entered the yard in December 2006, where a 12-year-old girl was playing after school with Seven, her St. Bernard. Johnmichael O''Hare and Anthony Pia of civil-rights violations related to their Dec. 20, 2006, warrantless entry through the front gate of the home where Glenn Harris lived with his girlfriend',2006,12,2014,10,'2014-11-01 17:05:06.097138','2014-11-25 21:18:06.558254','CT','Hartford',NULL,'','other',1,'t','','t','t','f','f','f','f','',NULL,82,2,NULL);
INSERT INTO "incidents" VALUES(127,'6349be79-a1b7-4996-a00b-958504960fd8','A trial set to take place this week has been set aside after a tentative settlement was reached in a lawsuit against a former Plaquemines Parish deputy and the current sheriff. The plaintiff -- a 31-year-old woman -- sued Elijah Gary and Sheriff Lonnie Greco after she said she was sexually assaulted by Gary during her arrest in late 2012. The woman told investigators that Gary molested her while taking her into custody on a theft charge. Her complaint led to Gary''s dismissal and prosecution. He pleaded guilty to a charge of malfeasance and obscenity, ending the criminal case. But the woman filed a civil case in federal court, naming the one-time deputy and sheriff as defendants.',2012,NULL,2014,10,'2014-11-01 17:09:24.974401','2014-11-01 17:09:24.974401','LA','New Orleans',NULL,'','unknown',1,'f','','f','f','f','f','t','f','',NULL,83,1,NULL);
