INSERT INTO "incidents" VALUES(131,'9916748b-0b82-4c63-8eb3-204771f46c2a','It all stemmed from an incident that happened on March 26. She says around 5:40 a.m., two officers, Joel Ayala-Acevedo and Anthony Echevarria, showed up at her door trying to serve a warrant for her son. he says she asked the officers to leave, closed the door and then opened it again. That’s when she says Ayala-Acevedo grabbed her arm, pushed her into a wall and threw her on the ground to arrest her. Davenport was arrested and charged with Felony Assault on a Police Officer, but her charges were dropped. She says she believes a video recording taken by a body camera on Ayala-Acevedo was her saving grace. NewsChannel 3 has asked for a copy of that video, but police refuse to release it.',2014,1,2014,10,'2014-11-06 15:01:16.110382','2015-01-29 18:02:38.790807','VA','Chesapeake',NULL,'','search-warrant',1,'f','','t','t','t','f','f','f','The officers claimed that she kicked them and that justified beating her but the charges against he were dropped.',50000,87,2,NULL);
