INSERT INTO "incidents" VALUES(133,'6968593d-2424-4b59-a2cd-0aac2e049fb8','OKLAHOMA CITY -- An Oklahoma City police officer was arrested Thursday and charged in relation to a string of violent sex crimes that investigators say he committed while on duty, reports CBS affiliate News 9. OKLAHOMA CITY -- An Oklahoma City police officer already accused in the sexual assault of 10 women has been charged with assaulting three more.
INSERT INTO "incidents" VALUES(134,'646ac164-91ec-426f-b5cc-e297aec85164','Police send a SWAT team to serve a warrant for a recreational pot smoker. Shoot the family dogs in the process and recover trace amounts of residue. "I was laying right here, and I really thought I was being murdered," Larry Lee Arman admitted. "I don''t want to say by who. I thought it was like, the government." t was 7 a.m. when police executed what is known as a no-knock search warrant. Arman said he and his two children were sleeping on a mattress when armed members of the SWAT team barged through the front door. The next thing he remembers is seeing the family''s long-time dogs stagger and fall.
INSERT INTO "incidents" VALUES(135,'d873c1be-309d-4183-aa19-6d83a421e22d','A LaGrange, Mo., man has agreed to a settlement for federal lawsuit which he filed against a LaGrange police officer who shot and killed his dog in 2010, reported Thursday''s WHIG News.
