INSERT INTO "incidents" VALUES(138,'4e666672-d729-4bc8-b2bd-8685a859a308','Police officer slaps man for refusing a search. Saratoga County Deputy Shawn Glans had no idea he was being recorded as he tried to intimidate a man into allowing him to search his car, which is why he slapped him on the back of his head while yanking the keys out of his hand, tossing them to another deputy who searched the man''s car and found nothing illegal.',2014,11,2014,11,'2014-11-10 03:02:12.913456','2014-11-13 03:48:50.311568','NY','Saratoga',NULL,'','traffic-stop',2,'f','','t','t','f','t','f','f','',NULL,92,2,NULL);
INSERT INTO "incidents" VALUES(139,'d1b4a4d4-e8cf-4907-b71c-ea63755bcaba','Park Ranger arrests man who is clearly handicapped for parking in a handicap spot. Eventually cited him for failure to follow a lawful order. On Dec. 22, 2012, Esquibel and his family were visiting Sequoia National Park. As they entered the gate, a park employee (not named in court papers) asked him to wait at the entrance until traffic thinned out. Esquibel showed the employee a handicap park pass that allows him to enter for free, the lawsuit says.
INSERT INTO "incidents" VALUES(140,'2de1a0ad-7a06-4761-9f88-f19678e7f970','Police officers let an off-duty cop buddy kick a handcuffed man in the head. SEATTLE -- Jake Baijot-Clary was lying, face down, on a wet sidewalk with his hands cuffed behind his back when he was kicked in the head. "I saw it coming," he said. "And as I looked up to him, he came and just stomped down on my face, bounced my head off the curb." The kick, which was caught on the dash cam of a police cruiser, came from an off-duty Seattle police officer, Garth Haynes. ',2010,12,2011,1,'2014-11-10 03:18:16.271968','2014-11-10 03:20:16.947604','WA','Seattle',NULL,'','other',1,'f','','t','f','t','f','f','t','',75000,93,1,NULL);
INSERT INTO "incidents" VALUES(141,'9267ca21-6816-4224-b886-33dc1b0fd933','An Oklahoma police officer is on paid administrative leave, following an altercation with ambulance personnel while they were transporting a patient to the hospital. Trooper Daniel Martin, a member of the Oklahoma Highway Patrol (OHP), was caught on video by his police vehicle''s dashboard-camera in a physical struggle with paramedic Maurice White, Jr. after Martin pulled the ambulance over. Martin had previously passed the ambulance while en route to another call, but came back and pulled over the ambulance. The incident occurred on May 24, and footage from the police dash-cam was released following a tort claim filed by paramedic White.',2009,5,2009,7,'2014-11-10 19:39:10.012158','2014-11-10 19:39:10.012158','OK','',NULL,'','traffic-stop',1,'f','','t','f','f','t','f','f','',NULL,26,1,NULL);
INSERT INTO "incidents" VALUES(142,'c5e1ca5a-f33e-42d7-8167-c254df7c38ba','Police send a SWAT team to raid a man''s house over marijuana. Man thinks he''s being robbed and grabs a gun. Man shot dead. Death could have been avoided had the police knocked like civilized human beings.  No contraband was found after the search concluded. A multi-million dollar settlement concludes the disturbing case of Jose Guerena, the Iraq veteran who was riddled with bullets in his own home during a faulty SWAT raid.  Not only did these armor-clad police perform a haphazard assault on an innocent family’s home, they prevented their victim’s wounds from being treated after they shot him dozens of times.   The hefty disbursement of tax dollars to the Guerena family may be warranted, but does nothing to reprimand the trigger-happy officers, nor does it effectively reign in the aggressive department which is responsible for recklessly arranging paramilitary raids on people suspected of growing plants.',2011,5,2013,9,'2014-11-10 22:24:59.685087','2014-11-10 22:24:59.685087','AZ','Tuscon',NULL,'','search-warrant',1,'f','','t','f','f','t','f','f','The use of the firearm would have been justified but under the poisoned tree rule it becomes abuse because the police escalated the situation rather than knocking on the door.',3400000,94,NULL,NULL);
