INSERT INTO "incidents" VALUES(146,'d51763ad-9e10-4716-937e-768a27219d2a','City commissioners on Monday voted unanimously to settle the lawsuit brought by Christina West, who suffered broken bones and other injuries during her DUI arrest on Aug. 10, 2013. They approved the settlement in open session after going into closed session to discuss it, which is allowed under statutes. Two officers directly involved in the arrest, Chris Ormerod and Matthew Smidt, and two supervisors at the scene, Sgts. George Creamer and William Faust, were later disciplined. Ormerod received the harshest penalty, a two-week suspension without pay.',2013,8,2013,8,'2014-11-13 14:24:55.172219','2014-11-13 14:24:55.172219','FL','Tallahassee',NULL,'','traffic-stop',1,'f','','t','f','f','f','f','f','',475000,96,4,NULL);
