INSERT INTO "incidents" VALUES(150,'a666d949-c752-4038-92b6-b5532251427c','Police use a SWAT team to raid a spa suspected of offering prostitution services. Excessive show of force and some civil forfeiture. Lebanon SWAT officers entered the Lee Spa at about 6 p.m. and found five people, two of which were believed to be customers, according to Chief Scott Bowen. Police would not release the names of those present at the spa, and no charges were filed, but are expected.',2013,9,2013,9,'2014-11-14 21:47:18.989556','2014-11-14 21:47:18.989556','TN','Lebanon',NULL,'','search-warrant',5,'f','','f','f','t','t','f','f','',NULL,100,NULL,NULL);
