INSERT INTO "incidents" VALUES(158,'8f3122ec-971e-4372-aaee-12a21c09cc54','A former Skokie Police officer was sentenced to two of years probation Wednesday after he pleaded guilty to official misconduct for shoving a woman in the lockup at the north suburb’s police station, causing severe injury to her face, the Chicago Sun-Times is reporting.
INSERT INTO "incidents" VALUES(159,'e5888376-fa77-4995-9fec-deb4a3c44fe1','Pasco County Sheriff’s Office has fired Deputy Carlos Lopez, 41, after he allegedly kissed and groped a woman by force at her Land O’Lakes home on Oct. 31. ‘If you didn’t have your family in the house, I would have taken your clothes off,’ Lopez allegedly told the 44-year-old victim.',2014,10,2014,11,'2014-11-14 23:19:18.135610','2014-11-14 23:19:18.135610','FL','Land O'' Lakes',NULL,'','other',1,'f','','f','f','f','t','t','f','',NULL,105,1,NULL);
INSERT INTO "incidents" VALUES(160,'a55d0d08-cefe-42b1-999b-cfb4fb0722ea','Albuquerque Police Officer Pablo Padilla pulled over UNM law student Jeremy Martin for DWI in April. Martin ignored Padilla’s demands to sit on the curb and begged the officer to let him go. Instead, Padilla is accused of kneeing the 25-year-old in the groin before cuffing him. Padilla grabbed the phone out of the man’s hand. Later, Padilla’s lapel camera shows him deleting video from the cell phone of another one of Martin’s passengers.
INSERT INTO "incidents" VALUES(161,'dcce0b6a-4c98-438f-b7a7-56b2de9a2fa9','Video footage has emerged showing Darren Wilson – the police officer who shot and killed Michael Brown, an unarmed black 18-year-old in Ferguson, Missouri – threatening and arresting a resident who refused to stop filming him with a cellphone.
INSERT INTO "incidents" VALUES(162,'bddaeff0-7a65-4a93-aa9c-260d1d9f3133','On Memorial Day Weekend, motorcycle rider Chris Moore was arrested by Dallas Deputy Sheriff James Westbrook. The arrest was part of crackdown against sport bike riders. Moore says Westbrook made up a charge in order to gain access to the video camera mounted on his helmet.
INSERT INTO "incidents" VALUES(163,'cdd56312-7554-46e1-8a98-20ada1eae7b8','Chris V. Lollie, 28, is seeking $500,000 in compensatory damages plus punitive damages to be determined at trial. The suit alleges that officers used excessive force, detained Lollie without “a reasonable, articulable suspicion” and committed battery against him on Jan. 31. Officers Lori Hayne, Michael Johnson and Bruce Schmidt, who are named in the lawsuit, responded to the scene. Hayne questioned Lollie about his identity as he walked through the skyway, Lollie’s video shows. Lollie declined to identify himself, noting that it was within his rights since he hadn’t done anything wrong.
INSERT INTO "incidents" VALUES(164,'3056109b-ff4f-4a46-ad41-5c61f6c5d0b5','Officer handcuffs and detains citizen who is not suspected of a crime for failing to identify himself. Brenton Norton. However, officer Liner, with callous disregard for the actual law, proceeded to handcuff Norton until he answered his questions, despite having any reasonable articulable suspicion. ',2014,NULL,2014,10,'2014-11-17 14:30:17.532493','2014-11-27 04:56:19.333099','SC','Forest Acres',NULL,'','chance',1,'f','','f','f','t','f','f','f','',NULL,108,1,NULL);
INSERT INTO "incidents" VALUES(165,'c1cf3a19-b7e7-4bae-bb9a-d8aafae3a2e2','Tunde Adeyale is filing a multi-million dollar lawsuit against the Mt. Rainier police department after he was assaulted and ticketed for getting his car stuck in the snow. Adeyale pleaded with officers to hear him out, and explained that he did not want any trouble, but the officers refused to listen to him, and responded with more threats, one of the officers even threatened to put him in the hospital. Seconds later, another officer moved in and punched Adeyale, knocking him unconscious momentarily.',2014,3,2014,9,'2014-11-17 14:44:41.738907','2014-11-17 14:44:41.738907','MD','Mt. Rainier',NULL,'','traffic-stop',2,'f','','t','f','f','t','f','f','',NULL,109,2,NULL);
