INSERT INTO "incidents" VALUES(168,'48a01e0c-e924-46f8-ac12-10590a1c54e3','Officer Dustin Fetz was out ‘fighting crime’ on the night of May 21, 2013 when he saw his chance to potentially stop the crime of the century. Inside the car was the diabolical criminal mastermind, Zoe Brugger and her boyfriend. Fetz knew in his heart that this evil couple must be in possession of an illegal plant so he did what he had to do to find it. Fetz was so dedicated to the cause of controlling what people can put in their own bodies that he didn’t let anything like silly Constitutional rights get in his way. So, when Miss Brugger refused the search of her vehicle, he searched it anyway; but not before heroically forcing her to humiliate herself in public by turning her bra up and shaking it out in the middle of a parking lot.',2013,5,2014,11,'2014-11-17 15:25:42.589692','2014-11-17 15:25:42.589692','FL','Lakeland',NULL,'','traffic-stop',1,'f','','f','t','f','f','f','f','',25000,111,NULL,NULL);
INSERT INTO "incidents" VALUES(169,'7771e7b6-f872-410d-83a4-8bd66240eef4','Last year, University of Virginia student Elizabeth Daly and two friends went into a grocery store to purchase some refreshments. Plainclothes officers tries to arrest them for possession of beer which scared the girls and caused them to flee. They were arrested.',2013,1,2014,11,'2014-11-17 15:32:15.424720','2014-11-27 04:45:40.223655','VA','Charlottesville',NULL,'','chance',2,'f','','f','f','t','t','f','f','',212500,112,6,NULL);
