INSERT INTO "incidents" VALUES(171,'decbdf3f-5ac5-4e25-a5fb-c6625f940477','The St. Paul City Council is due to approve a $95,000 settlement Wednesday to a man who was left with a fractured skull and eye socket and a broken nose after an encounter with police.
INSERT INTO "incidents" VALUES(172,'a9812379-3087-4639-b16c-6333434acd4f','Marvin Booker, 56, died on July 9, 2010. Four deputies and a sergeant shocked him with a Taser, put him in a "sleeper hold" and lay on top of him in an effort to control him during booking.
INSERT INTO "incidents" VALUES(173,'c3cc7a5c-8a8c-40c6-8e6c-6a2dd1ef3596','Incident 1 of 4: C.S., a 26-year-old man, was stopped on March 18 at 12:58 a.m., for driving 16 mph over the speed limit. C.S. acknowledged coming from a bar and drinking alcohol, but Miller did not issue him summonses or investigate whether C.S. was driving while intoxicated.
INSERT INTO "incidents" VALUES(174,'d611dfe6-0e8a-4d06-b000-6e3d0911ca03','Incident 2 of 4: N.S., a 26-year-old man, was stopped on Aug. 31 at 2:39 a.m. but was not issued a ticket. Video shows the officer''s pants open and his genitals exposed.
INSERT INTO "incidents" VALUES(175,'4753b2f7-511c-4ff9-91c7-53db017a7d81','Incident 3 of 4: J.A., an 18-year-old man, was stopped on Plotts Road on Sept. 2. When the officer approached, J.A. noticed the zipper was down and thought Miller was either exposing himself or wearing pink or flesh-colored underwear.
INSERT INTO "incidents" VALUES(176,'84aa2d69-fbb7-45eb-ae52-3e1190ce687b','Incident 4 of 4: A.B., a 22-year-old man, was driving home from O''Reilly''s Pub around midnight Oct. 23 when he was stopped on Lower Spring Street. The officer took A.B.''s paperwork and went back to his vehicle.
