INSERT INTO "incidents" VALUES(178,'35fdc9db-ae08-4717-a74e-7f99f5b28661','Salinas, Gilroy and Morgan Hill police were acting upon a search warrant about 7:15 a.m. May 23, 2013, when they burst in on the Alvarado family on the 200 block of Park Street. Plaintiffs include Alberto Alvarado, 62; Martha Alvarado, 58; and their 14-year-old granddaughter. Alberto and Martha Alvarado were ordered at gunpoint to lie prone in the driveway and an officer handcuffed them. At the time Alberto Alvarado was on dialysis for kidney failure and required his catheter site to remain sterile. However, the officers ignored Martha Alvarado’s request that her husband be allowed to sit in a chair or be taken inside, according to the complaint.',2013,5,2014,11,'2014-11-19 19:46:25.163121','2014-11-19 19:46:25.163121','CA','Salinas',NULL,'','search-warrant',3,'f','','t','t','t','t','f','f','',NULL,115,NULL,NULL);
