INSERT INTO "incidents" VALUES(180,'bdf42099-18d9-4b41-af51-566722383835','Officer maces a 17-year-old that was no resisting. Cameron Rader, a 17-year-old senior at PHS, said the officer claimed that Rader had pushed him. Rader said when he denied touching the officer, the man shoved him backward into a walkway.',2014,11,2014,11,'2014-11-20 18:05:56.704064','2014-11-27 04:47:44.971599','AL','Phenix City',NULL,'','chance',NULL,'f','','t','f','t','f','f','f','',NULL,117,1,NULL);
INSERT INTO "incidents" VALUES(181,'2c0faa8f-fb43-446a-b472-fa32c4c8c2ff','A Chicago police officer has been indicted on federal charges, accused of using excessive force when he allegedly punched a man during an arrest in 2012, and kicked him while he was handcuffed and lying on the floor face-down. Aldo Brown, 37, has been charged with one count of violating a victim’s civil rights, and two counts of obstruction of justice. Brown, who has been an officer since 2002, has not yet been scheduled for arraignment. The victim was then handcuffed again, and Brown pulled a gun from the man’s rear pants pocket, according to prosecutors. Brown then allegedly kicked the man while he was lying on his stomach, before Brown and his partner arrested the man.
INSERT INTO "incidents" VALUES(182,'a446ee9a-5d72-4598-9179-a412ca4e9ad0','A Missouri homeschooling family is suing a sheriff and another officer who forcibly entered their home without a warrant, Tasered the father, pepper-sprayed the mother and put their children in the custody of social service workers. A court already has ruled that the actions of Sheriff Darren White and Capt. David Glidden of Nodaway County, Missouri, violated the U.S. Constitution, resulting in the dismissal of charges of child endangerment and resisting arrest against the couple, Jason and Laura Hagan, of New Hampton. Glidden first demanded to be allowed into the home and was denied permission. So, according to the complaint, he pepper-sprayed Jason and then Laura.
INSERT INTO "incidents" VALUES(183,'f6ed0f65-1e53-401f-b58e-9265c319a345','PITTSBURGH —A federal court jury convicted a police officer of violating a man''s civil rights by using a stun gun on him three times while he was handcuffed. Wednesday''s felony conviction of suspended Millvale Officer Nicole Murphy effectively means she''ll never work as a police officer again, barring a successful appeal. It also means she''ll likely face up to three years in prison when she''s sentenced March 13, according to defense attorney Robert Stewart. Murphy acknowledged using the device on Thomas Jason James Smith after his arrest for public drunkenness in September 2012.',2012,1,2014,11,'2014-11-21 00:37:14.145664','2014-11-27 04:48:23.835284','PA','Pittsburgh',NULL,'','custody',1,'f','','t','f','f','f','f','t','',NULL,5,1,NULL);
