INSERT INTO "incidents" VALUES(185,'7ca5fa24-b1fc-4844-b2dc-0fda295a0866','Incident 1 of 2: Joshua Garland Laningham, 29, was indicted on a charge of theft of more than $1,500 and less than $20,000 after he allegedly took money from three individuals on March 30 and April 8 while in uniform.',2014,3,2014,11,'2014-11-21 01:02:08.320223','2014-11-21 01:02:08.320223','TX','Sanger',NULL,'','unknown',2,'f','','f','f','t','f','f','f','',NULL,120,1,NULL);
