INSERT INTO "incidents" VALUES(187,'bdfcee1d-d0ff-4fa9-87cf-c6153edae9bc','Officers arrest a man because he didn''t identify himself when he was not legally required to. From the OP, "I was just standing in a vacant dirt lot watching some people jump a car when the police pull up and ask for IDs. Nothing was stolen and everything was legal. They checked their IDs and when they were finished they focused on me. I refused to identify myself because according to the law I''m not required to. The police will lie, violate your rights and even break the law because they believe they''re above the law. Watch and you''ll see what happens." Sacramento police officers Michelle Sunny Cranford and Erin Renee Peterson became suspicious when they saw the men jump start the car because apparently that’s how they hot-wire cars in Northern California.',2014,11,2014,11,'2014-11-21 03:26:26.764316','2014-11-27 04:48:40.973740','CA','Sacramento',NULL,'','recording',1,'f','','f','f','t','f','f','f','',NULL,121,2,NULL);
INSERT INTO "incidents" VALUES(188,'4ccc75dc-e139-4e0c-881d-f53fbbb2a6ec','Officers beat and mace an 80-year-old man because they feared for their lives. Bill Swan was on his tractor when he noticed a utility crew attempting to dig on his property and approached them to tell them to vacate his property. The workers then called police, according to KCTV 5.
INSERT INTO "incidents" VALUES(189,'c7fc17ed-169e-41d9-8087-a753ee007026','Ferguson police officer rapes a woman in custody.  A former Ferguson corrections officer faces felony charges and a lawsuit for allegedly having sex with a pregnant inmate and allowing her to escape. Jaris Hayden, 29, will be arraigned Dec. 3 on charges of acceding to corruption by a public servant, permitting escape and two counts of sexual contact with a prisoner. The incident allegedly happened Oct. 9, 2013. Hayden was indicted by a grand jury earlier this month, and the woman filed her lawsuit against Hayden on Friday in federal court.',2013,10,2014,11,'2014-11-21 03:53:46.210175','2014-11-21 03:53:46.210175','MO','Ferguson',NULL,'','traffic-stop',1,'f','','f','f','t','f','t','f','',NULL,106,1,NULL);
INSERT INTO "incidents" VALUES(190,'933309aa-dc49-4eab-876f-cca6d2b3f9a0','A rookie cop fatally shot an unarmed man inside a dimly lit Brooklyn housing project stairwell late Thursday night — igniting an investigation by the NYPD’s Internal Affairs Bureau, authorities said. Peter Liang and his partner, Shaun Landau, also a rookie, were descending from the eighth-floor at the Pink Houses at 2724 Linden Blvd. about 11:15 p.m. when 28-year-old victim, Akai Gurley, entered from the seventh floor with his girlfriend — startling the cops, police sources said.',2014,11,2014,11,'2014-11-21 18:10:42.830631','2014-11-27 04:49:09.934397','NY','New York',NULL,'','chance',1,'f','','t','f','f','f','f','f','',NULL,31,2,NULL);
INSERT INTO "incidents" VALUES(191,'d0b47543-8ec7-46a1-bd27-52ba075bada9','But his career took a final nosedive in August 2011, when Bosque was called to the scene of a domestic dispute between Korey Davis, a youth counselor, and his baby’s mother.
INSERT INTO "incidents" VALUES(192,'e1df32c5-ddc8-42ce-88cf-e0910c51061e','CLEVELAND -- A chase that ended with 13 officers firing 137 rounds, killing two people, began with a pop – perhaps a gunshot or backfire from a car speeding past police headquarters. Police don''t know why the driver, Timothy Russell, 43, refused to stop. Russell had a criminal record including convictions for receiving stolen property and robbery. His passenger, Malissa Williams, 30, had convictions for drug-related charges and attempted abduction. Jeff Follmer, president of the police union, defended the officers'' actions and said officers used force to confront a driver using his vehicle as a potentially deadly weapon. “We felt it important to address the conduct of all the shooters, not just officer Brelo,” Gilbert said, referring to Michael Brelo, who faces two counts of voluntary manslaughter for having jumped on the hood of Russell’s car and firing the last 15 rounds into the windshield. He fired a total of 49 rounds. Five supervisors face misdemeanor dereliction of duty charges.',2012,11,2012,11,'2014-11-21 19:25:50.123249','2014-11-21 19:25:50.123249','OH','Cleveland',NULL,'','traffic-stop',2,'f','','t','f','f','f','f','f','',3000000,64,6,NULL);
