INSERT INTO "incidents" VALUES(205,'b55d9ee3-56ae-4b25-9e3f-5b97f0b2dc4c','January 2009: Alexander Landau and his passenger Addison Hunold were pulled over for an illegal left turn. Officer Randy Murr asked for consent to perform a search of the vehicle. Landau asked to see a warrant, and Officer Murr responded by punching him in the face and knocking him to the ground. Officer Murr, along with officers Ricky Nixon and Tiffany Middleton, then proceeded to beat him for several minutes with police radios and a flashlight. After the beating had stopped, Landau heard one of the officers say, "Where''s that warrant now, you fucking nigger?". By the time the incident went to court, Officer Murr had been fired because of his involvement in the beating of Michael DeHerrera. Officer Nixon had been fired as well, due to his involvement in an incident at the Denver Diner wherein women were clubbed and maced. The City of Denver agreed to settle the case and gave Landau $795,000.00',2009,1,2011,5,'2014-11-24 20:10:18.272669','2014-11-24 20:10:18.272669','CO','Denver',NULL,'','traffic-stop',1,'f','','t','t','t','f','f','f','',795000,16,2,NULL);
