INSERT INTO "incidents" VALUES(245,'e0411258-4f1b-4f84-963a-7f8c87e8e94e','Chicago and Glenview have agreed to pay about $195,000 to settle a federal lawsuit filed after a judge accused police officers from the departments of lying under oath during a hearing about a drug case. The five officers — Jim Horn and Theresa Urbanowski of Glenview and James Padar, Vince Morgan and William Pruente of Chicago — testified at a spring hearing about pulling over a Glenview man the previous June for failing to use a turn signal and then arresting him after discovering marijuana in an open backpack on his back seat. Incident date is the date of the lying under oath, not the actual stop.',2014,3,2014,8,'2014-12-04 01:31:14.143487','2014-12-04 01:31:14.143487','IL','Chicago',NULL,'','other',1,'f','','f','f','t','f','f','f','',195000,118,5,NULL);
