INSERT INTO "incidents" VALUES(247,'9735abf8-8551-4423-bba5-2c2d399b90c1','Officer shoots unarmed man. Officer disregards department policies and puts herself in a situation where she can be scared by an unarmed man. Amy Wilburn. Kelvion Walker.',2013,12,2014,1,'2014-12-04 04:58:00.069605','2014-12-04 04:58:00.069605','TX','Dallas',NULL,'','traffic-stop',1,'f','','t','f','f','f','f','f','',NULL,135,1,NULL);
INSERT INTO "incidents" VALUES(248,'e3a7dd3a-67d1-464c-8b64-e86d6c7c4aec','Beth Gatny, a police officer in Euharlee, Ga., fatally shot 17-year-old Christopher Roupe after he opened the door for cops. According to the family and some witnesses the teenager was holding a Wii controller (which is a white stick, more or less) when he was shot once in the chest. Interesting note: a Grand Jury found there was probable cause to indict but for reasons unknown the prosecutor convened another grand jury which returned no bill.',2014,1,2014,1,'2014-12-04 17:15:43.566885','2014-12-04 17:18:35.636058','GA','Euharlee',NULL,'','search-warrant',1,'f','','t','f','f','f','f','f','',NULL,156,1,NULL);
INSERT INTO "incidents" VALUES(249,'ce00d067-9c33-4ef6-95f6-df4185ab3f3d','On July 17, 2014, Eric Garner died in the Tompkinsville neighborhood of Staten Island, New York, after a police officer put him in an apparent chokehold, a tactic banned by the New York City Police Department (NYPD). Garner was initially approached by Officer Justin Damico on suspicion of selling “loosies”, single cigarettes from packs without tax stamps. After Garner expressed to the police that he was tired of being harassed and that he was not selling cigarettes, officers made the move to arrest Garner. Officer Daniel Pantaleo, also on scene, put his arms around the much taller Garner''s neck, applying an apparent chokehold shown in a widely viewed video recording of the event. While lying face-down on the sidewalk surrounded by four officers, Garner is heard to repeat numerous times, "I can''t breathe". Garner was pronounced dead approximately one hour later at the hospital.',2014,7,2014,7,'2014-12-05 21:02:38.249477','2014-12-05 21:02:38.249477','NY','Staten Island',NULL,'','chance',1,'f','','t','f','f','f','f','f','',NULL,31,4,NULL);
INSERT INTO "incidents" VALUES(250,'9b86391e-4bba-49ce-914b-cb11273b9cbb','The evening of November 25th, Kansas City attorney Eric Crinnian was startled by a loud banging sound outside his house.  His first reaction was to arm himself, so he picked up a crowbar and went to investigate.  He says that a neighbor had recently suffered a burglary. Then he said one police officer started threatening him saying, “If we have to get a warrant, we’re going to come back when you’re not expecting it, we’re going to park in front of your house, where all your neighbors can see, we’re gonna bust in your door with a battering ram, we’re gonna shoot and kill your dogs, who are my family, and then we’re going to ransack your house looking for these people.”',2013,12,2013,12,'2014-12-05 21:19:33.075860','2014-12-05 21:19:33.075860','MO','Kansas City',NULL,'','other',1,'f','','f','f','f','t','f','f','',NULL,157,3,NULL);
INSERT INTO "incidents" VALUES(251,'2be8d216-3bd2-4559-ad26-de81222ebd93','A Hooper Bay man has been awarded a half million dollars for being excessively tasered by village police officers. A Bethel jury found that 35-year-old Thomas “Boya” Olson of Hooper Bay had been tasered between 15 and 18 times, which constituted excessive force. There were four defendants in the case. The three Hooper Bay officers: Dimitri Oaks, Charles Simon, and Nathan Joseph. The city of Hooper Bay was also a defendant.
INSERT INTO "incidents" VALUES(252,'d5de59d0-1331-4a8b-b31c-703c4bb87631','Taxpayers will pay $41,500 to settle a claim for damages from a Tampa woman arrested as she made a cellphone video of her husband''s DUI arrest. The City Council this week approved the settlement to Leeanna Presson, 40. Presson and her husband, William Viers, had friends visiting when Viers went out for cigarettes. Police Cpl. Mark Altimari pulled him over near his home.',2013,2,2014,12,'2014-12-06 15:05:59.468847','2014-12-06 15:05:59.468847','FL','Tampa',NULL,'','recording',1,'f','','f','f','t','f','f','f','',41500,159,1,NULL);
INSERT INTO "incidents" VALUES(253,'f0bd9158-6fe9-4210-aa5e-a3b28926f2cc','A Tomball-area man who says he was arrested while taking a cellphone video of an officer claims he was detained illegally. A Harris County Sheriff''s Office deputy did take the man''s cellphone while he was filmining but not necessarily for videotaping, Harris County Sheriff''s Office spokesman Alan Bernstein said Friday.',2014,11,2014,12,'2014-12-06 15:15:06.742644','2014-12-09 16:09:39.627413','TX','Tomball',NULL,'','recording',1,'f','','f','f','t','f','f','f','',NULL,160,1,NULL);
