INSERT INTO "incidents" VALUES(256,'6b79fbab-c9e9-4b23-8ce9-9428b89a90a4','Off duty officer uses his police powers to arrest a man for getting a good parking space. Detective Frank Maio allegedly attempted to park his vehicle in a spot in front of the 888 Shoes where he did off-duty security work. But not before Pierre parked his SUV in it first. And when Pierre got out to do some shopping, Maio ordered him to move. But Pierre refused, saying there was no reason to move -- the spot wasn''t reserved, so why should he? Pierre couldn''t believe he was being arrested simply for getting a parking spot, so when Maio tried to apprehend him, he called 911. Below is a recording of the call, which Maio was clearly unhappy about. Clausel  Pierre says Maio caused him severe pain during the arrest, including some broken bones.',2011,1,2014,12,'2014-12-07 16:10:08.677687','2014-12-07 16:10:08.677687','FL','Deerfield Beach',NULL,'','other',1,'f','','t','f','t','f','f','f','',NULL,60,1,NULL);
