INSERT INTO "incidents" VALUES(258,'a68e6aaf-5761-45a6-b935-5b779d904af6','Erica Noonan, 31, says Police Officer Carlos Becker pulled her over on Fordham Road on March 11, 2013, because he found her attractive, videotaped her rear end with his cell phone while she was handcuffed at a police precinct and then pressured her into a date by promising to clear up her case. Also had sex with her when she was too impaired to object.',2013,3,2014,6,'2014-12-09 00:21:08.571784','2014-12-09 00:21:08.571784','NY','New York',NULL,'','traffic-stop',1,'f','','f','f','t','f','t','f','',NULL,31,1,NULL);
INSERT INTO "incidents" VALUES(259,'afd09a83-bc06-47e4-8c70-bfe2a1cfdf75','Officer uses taser on a man''s face, blinding him. Shocking footage shows the deputy hauling Matthew David Kelly, 24, out of the passenger''s side of a vehicle and then firing two electrified prongs at him. Trooper Bryan Cook. Kelly stood there with his hands on his head and appeared confused. The deputy activated the Taser for a second time, and according to the lawsuit, "sent a second surge of high voltage electricity" into Mr. Kelly''s eye.
INSERT INTO "incidents" VALUES(260,'1cc48ef8-1a33-433e-81e2-57f6daa49544','Deputy First Class Timothy Brooks violated the Jenkinses rights under the Maryland constitution when he shot their chocolate Labrador retriever, Brandi, on Jan. 9, 2010, while he and Deputy First Class Nathan Rector were at their Bullfrog Road home looking for their son, who was wanted on a civil warrant called a body attachment.
