INSERT INTO "incidents" VALUES(262,'e57114f7-1a35-447c-9889-ce878eff5f8b','Officers use a SWAT raid for what could have been a normal search. Results in an unarmed person getting killed. FAIRFAX COUNTY police officer Deval V. Bullock is a good cop who made one disastrous mistake: Bumped by his own car door, he accidentally fired his weapon and killed an unarmed, nonviolent, non-threatening suspect during a routine arrest in January. The shooting of Salvatore J. Culosi, an optometrist under investigation for being a sports bookmaker, was unintentional. But it was also negligent; under the circumstances, Mr. Bullock should not have had his finger on the trigger, nor even aimed his weapon at Mr. Culosi.',2006,1,2006,3,'2014-12-09 18:06:52.217426','2014-12-09 18:06:52.217426','VA','Fair Oaks',NULL,'','search-warrant',1,'f','','t','f','t','t','f','f','',2000000,35,1,NULL);
