INSERT INTO "incidents" VALUES(265,'f49edd14-3ae8-4b57-9941-cb2f7468e597','On June 16, Jane was walking by Prospect Hill Park when she saw Officer Devin Schneider talking to several teenagers in the park. Jane told the Journal she was concerned about possible criminal activity in the park, which she uses, and wanted to check out what was going on, including recording the scene on her cell phone. Jane told the Journal she walked over slowly and quietly and with both hands visible, and Schneider told the teenager to leave and turned his attention to her, demanding to see identification. Jane initially refused and asked if she was being charged with a crime, and according to the report Schneider told her if she did not produce identification she would be arrested. Jane did give her ID and Schneider later filed a criminal complaint against her for trespassing – being at the park after it had closed – and interfering with a police officer. Officer Devin Schneider',2014,6,2014,12,'2014-12-10 17:32:02.458349','2014-12-10 17:32:02.458349','MA','Somerville ',NULL,'','recording',1,'f','','f','f','t','f','f','f','',NULL,167,1,NULL);
