INSERT INTO "incidents" VALUES(270,'be24876e-960b-43b9-bc20-25dcc06179db','Officers shoot at unarmed man in his doorway. Arrested for assaulting an officer but released hours later because he didn''t do anything. Six months ago David Blair first claimed Dallas police officers shot at him for no reason. Now he’s suing the city and the two officers — Jesse Aquino and Richard Cantu — involved. The suit was filed in Dallas federal court Thursday, and asks for unspecified damages.',2013,10,2014,12,'2014-12-11 18:46:29.892652','2014-12-11 18:46:29.892652','TX','Dallas',NULL,'','other',1,'f','','t','f','t','f','f','f','',NULL,135,2,NULL);
