INSERT INTO "incidents" VALUES(273,'09288efd-1db2-4490-aff1-864285d40725','A raid team was sent to break into a home after allegedly smelling chemicals outside the building.  Instead of the meth lab they were hoping to find, deputies barged in on a sleeping 80-year-old man with poor vision.   The retired engineer was shot to death while still in his bed. Eugene Mallory and Tonya Pate was drawn under fire when local police thought they smelled chemicals associated with making methamphetamines on the property.   On the morning of June 27th, 2013, a raid team was sent to the property to serve a no-knock search warrant. John Bones. Patrick Hobbs',2013,6,2014,2,'2014-12-11 20:50:38.714050','2014-12-11 20:50:38.714050','CA','Littlerock',NULL,'','search-warrant',1,'f','','t','f','t','t','f','f','',NULL,11,6,NULL);
INSERT INTO "incidents" VALUES(274,'c75f2f4f-66e9-4489-a012-d7171f820824','Prosecutors dismissed all the criminal charges against Marcus Jeter, 30, of Bloomfield, N.J. and instead indicted two Bloomfield police officers for falsifying reports and one of them for assault after the recording surfaced showing police officers beating Jeter during a traffic stop, according to WABC of New York. A third has pleaded guilty to tampering.',2012,6,2014,7,'2014-12-11 21:03:59.382373','2015-03-08 03:49:38.287486','NJ','Bloomfield',NULL,'','911',1,'f','','t','f','t','t','f','t','',NULL,170,2,NULL);
