INSERT INTO "incidents" VALUES(277,'24c4f7b0-f7eb-4518-9c4f-3948a3595de6','Officer chases a teenager into his home and kills him in the bathroom. The teenager, Ramarley Graham, 18, was pronounced dead at Montefiore Medical Center. ABC reports the jury decided there wasn''t enough evidence to re-indict officer Richard Haste in the death of 18-year-old Ramarley Graham. Haste had been indicted by a different grand jury last year, but a judge threw out that indictment, citing a mistake by the assistant district attorney. Officer also pointed a gun at an 8 year old to demand that he open the door to the apartment building and made a woman pee on herself. Paulet Minzie. Jyevion Dixon. Eric Dixon.',2012,2,2012,2,'2014-12-12 02:56:10.839100','2014-12-12 02:56:10.839100','NY','New York',NULL,'','other',4,'f','','t','t','f','f','f','f','',NULL,31,1,NULL);
INSERT INTO "incidents" VALUES(278,'a2e0daf4-4771-4314-ac4e-3c43035c6262','In the video from March, Refus Holloway appeared to be handcuffed and not resisting when Officer William Escobar punched him in the head, then kicked him in the leg. Escobar faces two counts of battery and two counts of perjury, all misdemeanors, stemming from a March 15, 2014 incident, according to officials.  Documents show that Escobar stands accused of hitting Refus Holloway at least twice.  One abusing officer and two others enjoying the show.',2014,1,2014,10,'2014-12-12 03:10:56.477395','2015-02-19 19:49:21.954442','FL','Orlando',NULL,'','911',2,'f','','t','f','t','t','f','t','',NULL,27,3,NULL);
