INSERT INTO "incidents" VALUES(281,'ac0409aa-32b2-4837-8006-fe37cfc43630','Officer tries to use his position to sneak into a football game and threatens people that challenged him on it. A Yale University professor claims in a letter, which alders forwarded to the Board of Police Commissioners, that Police Chief Dean Esserman threatened to “shut the whole game down” when an usher at September’s Yale-Army game questioned the reportedly ticketless top cop’s entry to the Yale Bowl. Dan Weinberger, a city resident who teaches epidemiology at Yale University, wrote that he witnessed Esserman’s encounter with the usher and claims Esserman demanded the usher’s supervisor remove the worker from the premises.
INSERT INTO "incidents" VALUES(282,'4cac8015-3766-4ca7-8ee6-ef739584b3e2','Police enter a home without a warrant when it is clear that nobody is in danger. Use their tazers on the people inside. James Wood, a 34-year-old army reservist, was shocked with a Taser by Cotati officers in his apartment last May after a neighbor heard a man shouting at a woman and called police.',2013,5,2014,2,'2014-12-12 21:52:09.757166','2014-12-12 21:52:09.757166','CA','Cotati',NULL,'','911',2,'f','','t','t','f','f','f','f','',NULL,173,NULL,NULL);
