INSERT INTO "incidents" VALUES(286,'e5a92709-bd76-4f43-a86c-3f0f35a14eed','Woman arrested for taking pictures of an air force base. An East Quogue woman who was arrested and held for four nights on a misdemeanor trespassing charge after taking photos of a model of a helicopter at the Air National Guard 106th Rescue Wing in 2009 was awarded $1.112 million in damages by a federal jury Thursday following a trial on her false arrest lawsuit. Southampton Town Police Lt. Robert Iberger stopped her and demanded to know why she was taking photographs.
