INSERT INTO "incidents" VALUES(292,'5055c09e-cbb6-4380-8f26-b186f2facc39','Former Anderson, California, police officer Bryan Robert Benson, 30, of Shasta Lake, was sentenced today in federal court to five years in prison and 3 years of supervised release for violating the civil rights of a woman he arrested by sexually assaulting her while she was in his custody, announced the Justice Department and the U.S. Attorney’s Office for the Eastern District of California.',2010,5,2014,12,'2014-12-15 15:58:41.015340','2014-12-15 15:58:41.015340','CA','Anderson',NULL,'','traffic-stop',1,'f','','f','f','t','f','t','f','',NULL,182,1,NULL);
INSERT INTO "incidents" VALUES(293,'2f109c05-db4b-425d-9dc3-7a99dae51223','Authorities on Sunday arrested a Department of Public Safety officer accused of groping a woman during a traffic stop Saturday and then misleading investigators. Michael Selders, 47, pulled over a woman for a traffic stop early Saturday on La. 67 near Port Hudson Pride Road, according to an arrest report. He later told East Baton Rouge Parish sheriff’s investigators it was because she had run a red light. After making the woman get out of her car, Selders began to grope her and tried to kiss her on the lips, deputies said. She turned away and got back into her car, at which point Selders told her, “Don’t tell anyone about this,” the arrest report says.',2014,12,2014,12,'2014-12-15 16:02:18.072039','2014-12-15 16:02:18.072039','LA','',NULL,'','traffic-stop',1,'f','','f','f','t','f','t','f','',NULL,183,1,NULL);
INSERT INTO "incidents" VALUES(294,'ec6ff803-979c-433d-aabd-fe15ac99a7ae','Officer enters a home without a warrant and shoot a dog that approached him. Dog may have been aggressive or may not have been but the officer had no right to be there in the first place. On November 28th 2014, Jackson Police Officer Matt Peters came to 20 year old Eddie Harris’ residence looking for an individual to take to the hospital for a psychological evaluation. Peters entered the house without a warrant and when Harris came down to see who walked in his house, Peters shot his dog, Kane, just feet in front of him at the bottom of the stair case.',2014,11,2014,12,'2014-12-15 16:13:25.856216','2014-12-15 16:13:25.856216','MI','Jackson',NULL,'','other',1,'t','','t','t','f','f','f','f','',NULL,184,1,NULL);
