INSERT INTO "incidents" VALUES(296,'bf68bcff-37b4-4b75-8021-33f7909fc3e5','SWAT team deployed for man working on a tractor in his driveway. The violence befell upon John Hytrek one day in August 2012 while he was working on a tractor at his shop.  Without warning, Mr. Hytrek heard a van screeching up to his shop.  When he looked up, roughly 12 men were sprinting towards him with their rifles drawn.
INSERT INTO "incidents" VALUES(297,'7bb9e6be-34b8-4adf-b44a-a8de867d476c','Cops find tea leaves in someone''s trash and think it''s weed. Deploy a SWAT team rather than using a regular search. Robert and Adlynn Harte discovered how easily an innocent family can become the targets of state-sanctioned violence when a SWAT team showed up at their home looking for contraband.  The terrifying experience took place at 7:30 a.m. on April 20, 2012.',2012,4,2014,4,'2014-12-16 20:50:34.954089','2014-12-16 20:50:34.954089','KS','Leawood',NULL,'','search-warrant',4,'f','','f','f','f','t','f','f','It appears that there were grounds for a search, but not the use of a SWAT team.',NULL,186,NULL,NULL);
