INSERT INTO "incidents" VALUES(309,'14bbf6d8-8a41-490d-8cf1-77078a3e673b','The Knox County Sheriff''s Office fired a deputy and placed two other deputies on administrative leave after photos revealed a deputy used excessive force while busting a party near the University of Tennessee''s campus. The sheriff''s office fired Officer Frank Phillips, 47, immediately after an investigation revealed he used excessive force during the incident. The two other deputy seen in the pictures, Ronald Chaperon Jr. and Brandon Gilliam, were placed on administrative leave with pay pending the outcome of an investigation.',2014,4,2014,4,'2014-12-20 03:11:31.460145','2014-12-20 03:11:31.460145','TN','Fort Sanders',NULL,'','911',1,'f','','t','f','f','f','f','t','',NULL,195,3,NULL);
INSERT INTO "incidents" VALUES(310,'dc62be54-0a8b-4add-bc91-c1162316a05f','Officer gets drunk before duty then shoots a man thinking his cell phone is a weapon. Cleared of charges and back on the force. Chicago Police Officer Gildardo Sierra will not face any criminal charges for the killing of an unarmed man, Cook County prosecutors announced Tuesday, despite video footage that showed Sierra standing over the victim, Flint Farmer, and shooting him multiple times. Prosecutors concluded that Sierra may have reasonably mistaken Farmer’s cell phone for a gun, and therefore was justified in firing off all 16 rounds in his gun at the unarmed man.',2011,6,2013,9,'2014-12-20 03:26:52.854694','2014-12-20 03:26:52.854694','IL','Chicago',NULL,'','chance',1,'f','','t','f','f','f','f','f','',4100000,118,1,NULL);
INSERT INTO "incidents" VALUES(311,'3bc49de4-21aa-44eb-b1ba-575fa3776307','Officer punches 16-year-old boy that was in custody and under control by 3 other officers. Arrests two boys on charges even though they were not identified as the perpetrators. As three unformed officers struggled to handcuff one of the youths, the video shows a fourth plainclothes officer — identified by the Daily News as John McDevitt of the 7th Precinct – running up from behind and delivering two blows to the teen’s backside, although it remains unclear whether he was resisting arrest. Several bystanders, including one who later identifies herself as a lawyer and asks for the officer’s badge number, yell at the officer to stop. Police identified the youth as 16-year-old Denzel Funderburk, according to CBS.',2014,12,2014,12,'2014-12-20 20:20:21.255691','2014-12-20 20:20:21.255691','NY','New York',NULL,'','chance',2,'f','','t','f','t','f','f','t','',NULL,31,4,NULL);
INSERT INTO "incidents" VALUES(312,'fcfda65b-d3cb-422f-bace-e9cb53380725','A Santa Barbara Sheriff’s deputy used excessive force to arrest UCSB student Jay Shafer in 2009, and Shafer is entitled to $120,000 in damages for the physical injuries and emotional distress he suffered as a result, a jury decided Tuesday. Attorney fees are about 3 times that amount bringing the total to $480,000',2009,10,2014,12,'2014-12-20 20:26:31.912236','2014-12-20 20:26:31.912236','CA','Santa Barbara',NULL,'','911',1,'f','','t','f','t','f','f','f','',480000,196,1,NULL);
INSERT INTO "incidents" VALUES(313,'698b72f9-3367-4956-b3a4-2a0eb7ce81d4','Incident 1 of 2: By any reckoning, 2011 was a very rough year for Santa Barbara Police Officer Aaron Tudor, a strapping, muscular cop then in his fourth year on the force. It was arguably rougher, however, for two defendants whom — in separate incidents — Tudor would conclude had resisted arrest. By the time Tudor subdued Tony Denunzio — a 53-year-old with a checkered record — Denuzio would be tased 13 times, sustain three broken ribs, and a broken nose. That was in October 2011. One month later, Tudor would break the arm of 19-year-old Britteny Cotledge while bending her over the hood of his car. The snapping sound of Cotledge’s arm can be heard clearly over the background thrum in the video footage caught by Tudor’s patrol car camera. Tudor would contend she broke her own arm by squirming and resisting. Another officer on the scene with Tudor reportedly threw up at the time and was ministered to by emergency response technicians.',2011,10,2014,1,'2014-12-20 20:32:47.312262','2014-12-20 20:39:05.762449','CA','Santa Barbara',NULL,'','traffic-stop',1,'f','','t','f','f','f','f','f','',170000,198,1,NULL);
