INSERT INTO "incidents" VALUES(340,'93a523d7-9844-4539-b24f-80de18d84c3b','Officer runs stop sign, hits woman, and arrests her for drunk driving. It was February 20th, 2013, and Deputy Quiles was working the night shift on patrol at General Mitchell International Airport. Tanya Weyker was hurt so badly, she couldn’t blow into a breath-testing device or perform field sobriety tests.  But a Sheriff’s deputy arrested her for drunk driving anyway.  And the County hung those charges over her head for nearly a year, even long after blood tests proved she was perfectly sober.',2013,2,2014,8,'2014-12-30 02:59:02.952129','2014-12-30 02:59:02.952129','WI','Milwaukee',NULL,'','chance',1,'f','','f','f','t','f','f','f','',NULL,214,1,NULL);
