INSERT INTO "incidents" VALUES(362,'04c48869-7b3f-4e4c-bace-970d6b7f9380','Officer shoots teenager that had already been tased and restrained. Two officers were able to calm Vidal, reported Star News Online. A third arrived and entered the family''s home, and the teen was tased and restrained on that officer''s instructions, then shot in the chest. The central fact concerning the death of Keith Vidal, 18, does not seem to be in dispute: after the schizophrenic youngster was tased and restrained by two officers, a third stepped up, said "we don''t have time for this", fired into the scrum, then tried to do so again before being restrained. Vidal, who celebrated his birthday last month, was killed by the gunshot. Bryon Vassey',2014,1,2015,1,'2015-01-07 02:41:27.368137','2015-01-07 02:41:27.368137','NC','Boiling Springs Lake',NULL,'','911',1,'f','','t','f','f','f','f','t','',NULL,224,1,NULL);
