INSERT INTO "incidents" VALUES(364,'6f1f0779-aabf-4d9d-a5f6-50eddbc77562','On Wednesday, a grand jury assembled in the 30th District Judicial Court formally indicted James “Dennis” Parrott, the police chief for the Town of Rosepine. Parrott was indicted on two felony charges of malfeasance in office, sexual conduct, along with one count of felony stalking and one other felony charge of malfeasance in office. When arrested in August, Parrott was accused of stalking his estranged wife, while also utilizing the database of the police department to illegally run a license plate number.',2014,NULL,2014,12,'2015-01-07 17:21:22.967128','2015-01-07 17:21:22.967128','LA','Rosepine',NULL,'','other',2,'f','','f','f','t','t','f','f','',NULL,226,1,NULL);
