INSERT INTO "incidents" VALUES(368,'0fd5d0b4-6478-4aec-9115-cf304542cd03','Police beat the crap out of the wrong person even though he complied with their demands. he beating happened in May 2014 in the 10600 block of Westover Hills Boulevard. The victim, Roger Carlos, suffered broken teeth and injuries to his face, neck and back. Carlos said Thursday he has undergone two procedures to relieve neck pain because of the beating, and still has only limited movement. Two of the officers have been identified as Carlos Chavez and Virgilo Gonzalez. The third officer was not identified, because of the confidential nature of his position with SAPD. All three officers used accrued leave time instead of serving their suspensions.',2014,5,2015,1,'2015-01-09 14:17:50.909309','2015-01-09 14:17:50.909309','TX','San Antonio',NULL,'','chance',1,'f','','t','f','t','f','f','f','',NULL,229,3,NULL);
