INSERT INTO "incidents" VALUES(373,'1dfd968b-b96d-4a36-8f16-e13b71aa85ee','Civil forfeiture. El Willis hadn’t been charged with a crime. Nor was he carrying any drugs. But when police stopped his car last February, they didn’t need any evidence of criminal activity to take almost $20,000 in cash from him. Under civil forfeiture laws, police only need a mere suspicion of wrongdoing in order to seize private property. Meanwhile, no charge or conviction is required to keep it. Shonta Wilson. Bobby Queen.',2014,2,2015,1,'2015-01-11 20:47:50.780554','2015-01-11 20:47:50.780554','TN','',NULL,'','traffic-stop',2,'f','','f','f','t','f','f','f','',NULL,233,1,NULL);
