INSERT INTO "incidents" VALUES(375,'fdc97a5e-9674-4c54-8858-931a11845701','Colorado police use bad evidence and investigative techniques to arrest innocent people. The suit claims that Trinidad detectives Phil Martin and Arsenio Vigil relied on unsubstantiated accusations by confidential informant Crystal Bachicha while ignoring evidence that demonstrated that Gonzales and Valdez were innocent. Arrest affidavits in the case suggested that Bachicha had been supervised during her supposed drug purchases from the two women, when the police actually conducted no such surveillance; that the drugs obtained field-tested positive for heroin or meth, when in some instances they turned out to be fake; that the informant was thoroughly searched before and after each buy to prevent hanky-panky, when the searches actually were cursory pat-downs; that the audio recordings made by Bachicha contained incriminating evidence that, in fact, didn''t exist. The affidavits also omitted numerous material facts, including the payments made to Bachicha for each buy or other possible motives she may have had for setting up people like Gonzales, her former probation officer, or Valdez, who told Westword that she and Bachica have a history of "bad blood" between them. The case is being brought by the ACLU of Colorado and a prominent Denver law firm on behalf of two women, probation officer Danika Gonzales and school employee Felicia Valdez, who were arrested in the sting and subsequently lost their jobs.',2013,12,2015,1,'2015-01-12 04:48:17.313768','2015-01-12 04:48:17.313768','CO','Trinidad',NULL,'','other',3,'f','','f','f','t','f','f','f','',NULL,235,2,NULL);
