INSERT INTO "incidents" VALUES(486,'a98cbf36-d464-49fa-af3e-a96d764ce8e4','Illegal stop leads to thousands of dollars in tickets for crimes not committed. At 6am on January 4, 2009, Parker was in a pickup truck driving her colleagues, Rufus Smith and Gracie Jackson, to work at the Methodist Center. As she drove on Coulee Crossing Road, Officer David R. Godwin decided to follow. Dashcam video shows Parker obeyed the speed limit, signaled before turning and committed no violations. So Officer Godwin pulled her over.
