INSERT INTO "contributions" VALUES(5,'Former Baltimore police detective Joseph Crystal, who resigned this summer, is now suing both the Baltimore Police Department (BPD) and the police commissioner for not protecting him from retaliation. In 2012, Crystal reported an incident to prosecutors where a fellow cop assaulted a handcuffed suspect previously found in his girlfriend’s house. While police officers often complain about the “no snitch” culture in crime-ridden communities, that same culture often appears alive and well among police too. Crystal says after he reported the misconduct he found a rat on the windshield of his car that was parked outside his house.',2011,2014,NULL,NULL,'2014-12-28 04:15:44.348510','2014-12-28 04:15:44.348510','MD','Baltimore','retailiation',40);
