INSERT INTO "contributions" VALUES(11,'A former cop will spend the next six months in jail after a jury found him guilty of raping a Spring Breaker on South Padre Island.
INSERT INTO "contributions" VALUES(12,'Just a day after DA Kari Brandenburg announced for the first time in recent memory that she would pursue criminal charges against cops for an on-duty deadly shooting, there was another police shooting in the city, which has seen a spate of fatal police shootings since 2010 at eight times the rate of New York City.
INSERT INTO "contributions" VALUES(13,'Former Baltimore police detective Joseph Crystal, who resigned this summer, is now suing both the Baltimore Police Department (BPD) and the police commissioner for not protecting him from retaliation. In 2012, Crystal reported an incident to prosecutors where a fellow cop assaulted a handcuffed suspect previously found in his girlfriend’s house. While police officers often complain about the “no snitch” culture in crime-ridden communities, that same culture often appears alive and well among police too. Crystal says after he reported the misconduct he found a rat on the windshield of his car that was parked outside his house. Crystal also alleges that other officers refused to back him up on the streets. He alleges that in November 2012, no one from his unit responded to a call he put out over the radio that he was involved in a foot chase as part of a drug investigation.',2012,2014,NULL,8,'2015-03-07 22:05:06.834206','2015-03-07 22:05:06.834206','','','retailiation',40);
INSERT INTO "contributions" VALUES(14,'The San Antonio Police Department has fired an officer accused of holding his wife at gun point, a department spokesman confirmed Friday.
