INSERT INTO "contributions" VALUES(16,'There may be "thousands" of black and Latino officers facing retaliation from the New York City Police Department for opposing its illegal quota system, a new federal class action claims.
INSERT INTO "contributions" VALUES(17,'Officers Jim Azpilicueta, Anthony Gonzalez, Mike Rosario, Nancy Ogle, Steve Johnson and Cpl. Joseph Rivera say they spoke out against the quotas, which they claim were imposed by the Whittier Police Department in 2008, according to a suit filed Tuesday in Los Angeles County Superior Court.',NULL,NULL,NULL,NULL,'2015-03-10 14:55:56.325283','2015-03-10 14:55:56.325283','CA','Whittier','quota',298);
INSERT INTO "contributions" VALUES(18,'As a Bellefontaine Neighbors officer for a decade, Joe St. Clair was ordered to carry out a policy that he says required cops to issue a certain number of traffic tickets, and even traffic arrests. If they failed to do it, they could be fired.
INSERT INTO "contributions" VALUES(19,'Four more Tennessee Highway Patrol troopers — including one recently retired and a supervisor — said the allegations of a DUI arrest quota system in the department are absolutely true, and they dispute the agency administration’s denial.
INSERT INTO "contributions" VALUES(20,'A Newaygo County sheriff''s lieutenant was recently disciplined for telling county commissioners he removed deputies from overtime work if they failed to meet quotas for issuing tickets.
INSERT INTO "contributions" VALUES(21,'Questions in a Kansas town about a judge''s ruling against a former police officer. Jerry Ballinger of Augusta was arrested last year and charged with having sex with a 14-year old girl. Sentenced to probation',NULL,2013,NULL,8,'2015-03-10 15:58:08.219597','2015-03-10 15:58:08.219597','KS','Augusta','preference',302);
INSERT INTO "contributions" VALUES(22,'Officers in San Francisco were stealing property from people they arrested for drugs. Furminger, 48, of Pleasant Hill and Officer Edmond Robles of Danville were convicted of stealing property and thousands of dollars from drug-dealing suspects. Furminger claimed he was framed by a “dirty cop” Ray Vargas, who testified against the pair to get a lower sentence.',2008,2012,NULL,NULL,'2015-03-10 16:01:08.282181','2015-03-10 16:01:08.282181','CA','San Francisco','corruption',254);
INSERT INTO "contributions" VALUES(23,'Henry Glover, a 31-year-old resident of the Algiers neighborhood of New Orleans, was shot by NOPD officer David Warren on Sept. 2, 2005. When three men took Glover to a makeshift police compound for help, they were beaten, and two officers drove off with their car and Glover''s body. Glover''s charred remains were later found in the burnt-out car on a levee of the Mississippi River. On December 9, 2010 a jury gave a lenient verdict to David Warren, the cop who had shot Glover. They convicted him on a manslaughter charge, not murder, even though they had found him guilty of the shooting and had the option of a more serious verdict.',NULL,2010,NULL,12,'2015-03-10 16:04:40.798810','2015-03-10 16:04:40.798810','LA','New Orleans','preference',303);
INSERT INTO "contributions" VALUES(24,'Officer Mirjan Lolja, who allegedly choked Fatima Futa at the Tremont Ave. station on Dec. 23, was arraigned Friday in Bronx Criminal Court. ‘There is a glaring disparate treatment at play ... when a police officer is allowed to brutally assault a uniformed TWU Local 100 conductor and walk away with what amounts to a slap on the wrist,'' said Transport Workers Union Local 100 President John Samuelsen.',NULL,2015,NULL,1,'2015-03-10 16:09:34.522455','2015-03-10 16:09:34.522455','NY','New York','preference',31);
INSERT INTO "contributions" VALUES(25,'City rehires abusive cop and gives him back pay and retirement. Former Burbank Police Det. Mike Reyes was fired in June 2010 after city officials accused him of failing to report a use-of-force complaint reported to him by a suspect tied to a robbery at Porto’s Bakery in 2007, and lying about it a year and a half later to cover up the alleged misconduct.',NULL,2015,NULL,3,'2015-03-14 14:00:13.383373','2015-03-14 14:00:13.383373','CA','Burbank','rehire',307);
INSERT INTO "contributions" VALUES(26,'A former Exeter police sergeant was sentenced Thursday to 45 days in jail for having sex with a minor in the department’s Explorer program, the Tulare County District Attorney’s Office said.
INSERT INTO "contributions" VALUES(27,'Computers operating on the New York Police Department’s computer network at its 1 Police Plaza headquarters have been used to alter Wikipedia pages containing details of alleged police brutality, a review by Capital has revealed.',2007,2015,4,3,'2015-03-14 15:18:45.526550','2015-03-14 15:18:45.526550','NY','New York','corruption',31);
INSERT INTO "contributions" VALUES(28,'Orange County Sheriff''s Office deputy who was fired for excessive force is now working elsewhere as a police officer, WFTV has learned.
INSERT INTO "contributions" VALUES(29,'Three cops in Fort Lauderdale have been fired for sending racist texts as well as a video containing the N-word and featured Ku Klux Klan hoods, the police chief announced.
INSERT INTO "contributions" VALUES(30,'The San Francisco Police Department (SFPD) will investigate dozens of racist and homophobic text exchanges between a former SFPD sergeant convicted of corruption charges and four other police officers, the San Francisco Chronicle first reported. The texts made public Friday included jokes about Kwanzaa, calling African Americans monkeys, calling for the lynching of all African Americans, and even one that said, “Its [sic] not against the law to put an animal down.” The four officers have been on the force for at least a decade, with two having faced disciplinary action in the past. The revelation comes at a time when police practices around the country are under scrutiny for racial bias.',2011,2012,10,6,'2015-03-24 13:30:25.541020','2015-03-24 13:30:25.541020','CA','San Francisco','corruption',254);
